### What is the total population of all cities in Brazil? 
SELECT SUM(Population) FROM city WHERE CountryCode = 'BRA';

### What is the name and population of the largest city in the world?
SELECT Name, Population FROM city ORDER BY Population DESC LIMIT 1;

### What is the name of the capital of the country with the highest GNP (Gross National Product)?
SELECT city.Name FROM city
JOIN country ON city.ID = country.Capital
ORDER BY country.GNP DESC LIMIT 1;

### What is the name and continent of the country that speaks the most official languages? 
SELECT country.Name, country.Continent FROM country
JOIN (
  SELECT CountryCode, COUNT(*) as NumOfficialLangs 
  FROM countrylanguage WHERE IsOfficial = 'T'
  GROUP BY CountryCode
  ORDER BY NumOfficialLangs DESC LIMIT 1
) AS maxLangs ON country.Code = maxLangs.CountryCode; 

### What is the average Life Expectancy of the countries in the continent of Africa?
SELECT AVG(LifeExpectancy) FROM country WHERE Continent = 'Africa'; 

### How many countries have a population greater than 100 million?
SELECT COUNT(*) FROM country WHERE Population > 100000000;

### What is the name and population of the country with the smallest area?
SELECT Name, Population FROM country ORDER BY SurfaceArea ASC LIMIT 1;

### What is the name and percentage of the most spoken language in the world?
SELECT Language, Percentage FROM countrylanguage ORDER BY Percentage DESC LIMIT 1;

